import Video from './components/Video.js';
import React, {useState, useEffect} from "react"
import axios from "./components/Axios.js"

function App() {
  const [videos, setVideos] = useState([]); 

  useEffect(() => {
    async function fetchPosts() {
      const response = await axios.get('/v2/posts')
      setVideos(response.data);

      return response;
    }

    fetchPosts();
  }, [])

  return (
    <div className="app">
      <div className="app__videos">
        {videos.map((video) => (
          <Video 
          key = {video.name}
          url={video.url + "?sv=2020-08-04&ss=bfqt&srt=sco&sp=rwdlacuptfx&se=2021-07-31T23:19:38Z&st=2021-07-31T15:19:38Z&spr=https&sig=2ZRGoxJ71gHmJ5Mdqwx0a%2FA0YNu7oF9rxRcUDgfpbTk%3D"}
          channel = {video.channel}
          description = {video.description}
          song = {video.song}
          likes = {video.likes}
          azure = {azure}/>
        ))}
      </div>
    </div>
  );
}

export default App;
